import React,{useState} from 'react'
import './controlcentre.css'
import airdrop from './icon/Untitled_Artwork.png'
import focus from './icon/moonk.png'
import bluetooth from './icon/Untitled_Artwork 2.png'
import stage from './icon/stage.png'
import screen from './icon/screen.png'

export default function Controlcentre() {
    const [bw ,setBw]=useState('rgb(111, 111, 111)');
    const [bb ,setBb]=useState('rgb(111, 111, 111)');
    function click() {
        if (bw == 'rgb(111, 111, 111)' ) {
            setBw('rgb(191, 0, 234)')
        }
        if(bw=='rgb(191, 0, 234)'){
            setBw('rgb(111, 111, 111)')
        }
        if(bb == 'rgb(111, 111, 111)'){
            if (bw == 'rgb(111, 111, 111)' ) {
                setBb('rgb(191, 0, 234)')
            }
        if (bb == 'rgb(191, 0, 234)'){
                setBb('rgb(111, 111, 111)')
            }
        }
    }


  return (
    <div>
      <div className='dropcontrolcentre'>
         <div className="l">
         <a><p className='wf' style={{background:bw,}} onClick={click}><i className='fa fa-wifi'></i></p>Wi-Fi</a>
         <a><img src={bluetooth} style={{background:bb,}} onClick={click} className='blue' />Bluetooth</a>
         <a><img src={airdrop} alt="" className='air' />Airdrop</a>
         </div>
         <div className="r">
         <a ><img  className='focus' src={focus} alt="" />Focus</a>
         </div>
         <div className="x">

         <a className='stage' ><img  src={stage} alt="" />Stage Manager</a>
         </div>
         <div className="y">

         <a className='screen'><img src={screen} alt="" />Screen Mirroring</a>
         </div>
          <div className="bright">
          <a>Display</a>
          <input  type="range" name="" id="" />
          </div>
         <div className="volume">
         <a>Sound</a>
         <input  type="range" name="" id="" />
         </div>
        </div>
    </div>
  )
}
